import React, { useState, useEffect } from 'react';
import StdRegis from './db'; // นำเข้าโมเดล StdRegis ที่คุณสร้าง

function setdata() {
  const [stdRegis, setStdRegis] = useState([]);

  useEffect(() => {
    // เรียกใช้โมเดล StdRegis เพื่อดึงข้อมูลทั้งหมด
    StdRegis.find({}, (err, stdRegis) => {
      if (err) {
        console.error('Error fetching stdregis:', err);
      } else {
        setStdRegis(stdRegis);
      }
    });
  }, []);

  return (
    <div>
      <h1>Student Registration List</h1>
      <ul>
        {stdRegis.map(registration => (
          <li key={registration._id}>
            Student ID: {registration.studentId}, Name: {registration.studentName}, Major: {registration.major}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default setdata;
